// Initialization
function init(e) {
    // Replace XHR by GM_XHR to avoid CSP error
    $.ajaxSetup({ xhr: function() {return new GM_XHR; } });
    log("Load");
    if (typeof W === 'undefined' || typeof W.map === 'undefined' || typeof W.prefs === 'undefined' || document.getElementById('edit-panel') === null || WazeWrap.Ready != true) {
        setTimeout(init, 800);
        log("Map is still loading so we'll wait");
        return;
    }
    log('WME chargé');
    //Loading translations
    localization().then(() =>{
        if(window.location.href.indexOf("segment") > -1) {
            $('.lock-edit-view').after('<div id="WMESTSlock">' + Downlockicon + '&nbsp;' + Relockicon + '</div>');
            $( "#WMESTSvalidation" ).remove();
            $('.panel-header-component').append('<span id="WMESTSvalidation">' + validationicon + '</div>');
            Loadactions()
        }
    LoadTab();
    })

    // On change, check for changes in the edit-panel
    var WMESTSObserver = new MutationObserver(function(mutations) {
        mutations.forEach(function(mutation) {
            // Mutation is a NodeList and doesn't support forEach like an array
            for (var i = 0; i < mutation.addedNodes.length; i++) {
                var addedNode = mutation.addedNodes[i];

                // Only fire up if it's a node
                if (addedNode.nodeType === Node.ELEMENT_NODE) {
                    var locklevelDiv = addedNode.querySelector('.lock-edit-view');
                    var closureslistDiv = addedNode.querySelector('div.closures-list');

                    if (locklevelDiv) {
                        sent=0;
                        log('Lock icons added');
                        $( "#WMESTSlock" ).remove();
                        $('.lock-edit-view').after('<div id="WMESTSlock">' + Downlockicon + '&nbsp;' + Relockicon + '</div>');
                        $( "#WMESTSvalidation" ).remove();
                        $('.panel-header-component').append('<span id="WMESTSvalidation">' + validationicon + '</div>');
                        log('Validation icon added');
                        Loadactions();
                    }
                    if (closureslistDiv) {
                        sent=0;
                        log('Closure icons added');
                        $( "#WMESTSclosures" ).remove();
                        if(W.layerSwitcherController.checkboxState.attributes.ITEM_CLOSURES === true) {
                            $('.closures-list').before('<div id="WMESTSclosures">' + closureicon + '&nbsp;' + openicon + '</div>');
                            $('.closures-list').height("auto");
                        }
                        if(W.model.roadClosures.getObjectArray().length == 0) {
                            $('.closures-list').height("auto");
                        }
                        Loadactions();
                    }
                }
            }
        });
    });
    if (wmeStsTo != null) {//Check if it's a PL open
        autoLockClick();
      //Tab not loading correctly[BUG]
    }
    WMESTSObserver.observe(document.getElementById('edit-panel'), { childList: true, subtree: true });
    setTimeout(VersionCheck(),2000);
    $('#WSTSFS-Container').css('display', 'block');
}

// Functions used by the Script

//Make HTTP Requests
function makeHTTPRequest(type, url) {
    return new Promise((resolve, reject) => {
      GM_xmlhttpRequest({
        method: type,
        url: url,
        headers: {"Referer": document.location.href},
        onload: function(response) {
          resolve(JSON.parse(response.response));
        },
        onerror: function(error) {
          reject(error);
        }
      });
    });
  }

//Auto Lock Change
function autoLockClick (){
    if(document.getElementById('lockRank-4') === null) {
        setTimeout(autoLockClick, 800);
        log("Tab is still loading so we'll wait");
        return;
    } else {
        var levelTo = String(wmeStsTo-1);
        let wmeLockLvl='#lockRank-' + levelTo;
        log("Click on " + wmeLockLvl);
        document.getElementById("edit-buttons").style.display = "flex";
        $(wmeLockLvl).click();
    }
}

// Get browser language and load translations
async function localization () {
    var sheetName = sheetsAPI.sheetName
	async function requestTranslations (i18n) {
		const cons_connect_one = sheetsAPI.link + sheetsAPI.sheet + "/values/"
		const cons_connect_two = "!" + sheetsAPI.range + "?key=" + sheetsAPI.key
		var statusSheetsCallback = false
        //Trying to make Beta vs. Prod. Compatibility - HTTP
        if (location.host == "beta.waze.com"){
            await makeHTTPRequest('GET', cons_connect_one + sheetName + cons_connect_two)
            .then( function(response) {
                $.each( response.values, function( key, val ) {
            if (!(Array.isArray(val) && val.length)) {
                translationsInfo.push("Not Translated")
            } else {
                translationsInfo.push(val)
            }
                });
                statusSheetsCallback = true;
                log("Tampermonkey HTTP succeeded");
            } )
            .catch(function(response){
                log( "Tampermonkey HTTP failed!" );
                console.log(response)
            });
        }else{
            await makeHTTPRequest('GET', cons_connect_one + i18n + cons_connect_two)
		  .then( function(data) {
		    $.each( data.values, function( key, val ) {
            if (!(Array.isArray(val) && val.length)) {
                translationsInfo.push("Not Translated")
            } else {
                translationsInfo.push(val)
            }
                });
                    statusSheetsCallback = true;
                log("$.get succeeded");
            } )
            .catch( function() {
                log( "$.get failed!" );
            } );
        }
        if (statusSheetsCallback) {
            log('Connected to Google Sheets API')
        }else if (!statusSheetsCallback){
            WazeWrap.Alerts.error(ScriptName, 'Cannot connect to Google Sheets API')
        }


	//Closing async f(x)
	}
	//Checking if require translations different from any english language
	if (I18n.locale != "en-US" && I18n.locale != "en-GB" && I18n.locale != "en-AU" && I18n.locale != I18n.defaultLocale) {
		//Checking if the language is available for display
		if (suppLngs.includes(I18n.locale)) {
			sheetName = I18n.locale
			try {
				const waiting = await requestTranslations(sheetName)//Modify and ask for local storage before call the request
			} catch (e) {
				console.log("Error while calling 'requestTranslations' function");
			}
		}else if (!(suppLngs.includes(I18n.locale))) {
            if (localStorage.getItem('WMESTSlangalert') === ScriptVersion && 'WMESTSlangalert' in localStorage) {
                log('Alert already sent with this version')
            } else {
                WazeWrap.Alerts.warning(ScriptName, 'This language is not yet supported, loading default. Do you want a translation? ask your community, or send a request to wmests@fire.fundersclub.com with a gmail account to became localizator. Missing locale is: ' + I18n.locale)
                localStorage.setItem('WMESTSlangalert', ScriptVersion);
            }
			log("Loading default locale")
			try {
				const waiting = await requestTranslations(sheetName)//Modify and ask for local storage before call the request
			} catch (e) {
				console.log("Error while calling 'requestTranslations' function");
			}
		}
	}else{//Loads default language because no translation is required
		log("Loading default locale")
		try {
            const waiting = await requestTranslations(sheetName)//Modify and ask for local storage before call the request
		} catch (e) {
			console.log("Error while calling 'requestTranslations' function");
		}
	}
	log("Localization function have loaded correctly")
}

// Get City ID from Segment/venue ID
function GetCityID(selection, Type) {
    var StreetID = 0;
    if(Type != "segment")
    {
        StreetID = selection.model.attributes.streetID;
    }
    else {
        StreetID = selection.model.attributes.primaryStreetID;
    }
    if(StreetID) {
        return W.model.streets.getObjectById(StreetID).cityID;
    } else {
        return 0;
    }
}

// Get City name from City ID
function GetCity(CityId) {
    if(CityId>0) {
       return W.model.cities.getObjectById(CityId).attributes.name;
    }
    else {
        return $('span.full-address').text().split(",")[0];
    }
}

// Get Country name from City ID
function GetCountry(CityId) {
    if(CityId>0) {
       var CountryID = W.model.cities.getObjectById(CityId).attributes.countryID;
       return W.model.countries.getObjectById(CountryID).name;
    }
    else {
        return $('span.full-address').text().split(",")[$('span.full-address').text().split(",").length-1];
    }
}

function GetState(CityId) {
    if(W.model.cities.getObjectById(CityId))
    {
        var StateID = W.model.cities.getObjectById(CityId).attributes.stateID;
        var State = W.model.states.getObjectById(StateID).name;
        if(State===null)
        {
            return false;
        }
        else
        {
            return State;
        }
    } else {
        return false;
    }
}

function AskReason() {
    var x=0;
	while(x<1) {
		var Reason = prompt(translationsInfo[1][0] + " : ");//"Reason : "
		if(Reason == "") {
			alert(translationsInfo[2][0] + ' ');//"You need to complete the reason "
			Reason=null;
		} else {
			x++;
		}
	}
    return Reason;
}

// Construction of the request
function Construct(iconaction) {
    log('Construction');
    var answers = getPermalinkCleaned(iconaction);
    log('Permalink generated');
    var permalink = answers[0];
    var textSelection = answers[1];
    var countselected = answers[2];
    var selectedtype = answers[3];
    var RequiredLevel = answers[4];
    var CityName = answers[5];
    var CountryName = answers[6];
    var ShouldbeLockedAt = answers[7];
    var StateName = answers[8];
    var Details = "";
    var telegramDetails = "";
    var telegramReason = "";
    var chanel = "";
    var closureTelegramDetails = ""; //Bug while sending to telegram creates a new line, so this will fill it.
    var iconactionlocale = ""
    sent=0;
    abort=false;
    switch (iconaction) {
      case "Downlock":
        iconactionlocale = translationsInfo[34][0]
        break;
      case "Lock":
        iconactionlocale = translationsInfo[33][0]
        break;
      case "Validation":
        iconactionlocale = translationsInfo[35][0]
        break;
      case "Closure":
        iconactionlocale = translationsInfo[31][0]
        break;
      case "Open":
        iconactionlocale = translationsInfo[32][0]
        break;
      default:
        log("Not expected error while loading actionicon string")

    }
    if(iconaction == "Downlock" || iconaction == "Lock" || iconaction == "Validation") {
        if(iconaction == "Lock") {
            if(ShouldbeLockedAt == -1) { ShouldbeLockedAt == 1 }
            Details = prompt(translationsInfo[3][0] + " : ", ShouldbeLockedAt);//"To level"
            telegramDetails = Details;
            if (parseInt(Details) < -1 || parseInt(Details) > 6 || isNaN(Details)) {
              log("Invalid Details, nothing sent. Kill Switch Activated.")
		WazeWrap.Alerts.warning(ScriptName, translationsInfo[38][0]);//Please only enter numbers between -1 and 6 for Lock/Unlock required/request level
              abort = true;
              log("Kill Switch Activated.")
            }
            if(Details !== null) {
                if(parseInt(Details)>parseInt(RequiredLevel)) {
                    RequiredLevel = parseInt(Details);
                }
                if(RequiredLevel === null) {
                    RequiredLevel = parseInt(Details);
                }
                permalink = permalink + "&wmeststo=" + Details;
                Details = translationsInfo[3][0] + " " + Details;//"To level"
                telegramDetails = Details;
            } else {
                Details = 'Cancelled';
            }
        }
        if(Details !== 'Cancelled')
        {
            telegramDetails = "*" + translationsInfo[4][0] + " :* " + Details;//"Informations"
            Details = "\r\n" + translationsInfo[4][0] + " : " + Details + "\r\n";//"Informations"
        }
        if(iconaction !== "Lock" || Details !== 'Cancelled') {
            //Alert the editor if he can edit himself
            var lvlEditor = WazeWrap.User.Rank();
            if (lvlEditor >= RequiredLevel && iconaction != 'Validation') {
              if (confirm(translationsInfo[5][0]) === false) {//"You can perform this edit. Do you wish to continue?"
                log("User can edit, so no edit is sent.")
                abort = true;
                log("Kill Switch Activated")
              } else {
                log("Editor Level check triggered, user decided to continue anyway.")
                Reason = AskReason();
              }
            } else if(iconaction != 'Validation') {
				log("Editor Level checked, ask.")
                Reason = AskReason();
	    }
            if(Reason !== null) {
                //Fixing Reason var bug as undefined when only validation
                if (Reason == undefined) {
                  Reason = '';
                }
                telegramReason = "*" + translationsInfo[1][0] + " :* " + Reason;//"Reason"
                Reason = "\r\n" + translationsInfo[1][0] + " : " + Reason;//"Reason"
            } else {
                Reason = 'Cancelled'
            }
            telegramDetails = telegramDetails + "\n" + telegramReason
            Details = Details + Reason;
            chanel = "editing";
        } else {
            Reason = 'Cancelled'
        }
    } else if (iconaction == "Closure" || iconaction == "Open") {
        if(iconaction == "Closure")
        {
            var date = new Date();
            date.setDate(date.getDate() + 1);
            var Reason = prompt(translationsInfo[6][0], translationsInfo[36][0] + " " + date.toLocaleDateString("fr-FR") + " A<->B");//Check Drive sheet
            telegramReason = Reason;
            if(Reason == null) {
                Reason = 'Cancelled'
            } else {
                telegramReason = "*" + translationsInfo[7][0] + " :* " + Reason//"Details"
                Reason = "\r\n" + translationsInfo[7][0] + " : " + Reason;//"Details"
                Details = Details + Reason;
                closureTelegramDetails = "*" + translationsInfo[8][0] + "*"//"Closure Details"
                telegramDetails = telegramDetails + "\n" + telegramReason
            }
        }
        chanel = "closures";
    }
    log("City : " + CityName);
    var separatorCity="";
    if(CityName !="") {separatorCity = ", "}
    log("State : " + StateName);
    var separatorState = ""
    if(StateName !="") {separatorState = ", "}
    log("Country : " + CountryName);
    var urlRegex = /(https?:\/\/[^\s]+)/g;
    Details=Details.replace(urlRegex, function(url) {
        return escape(url);
    });
    log(Details);
    if(permalink.indexOf("-100") >= 0 ) {
        abort=true;
        WazeWrap.Alerts.error(ScriptName, translationsInfo[9][0]);//"Some segments aren't saved, please save them and try again"
    }
    var profileurl="https://www.waze.com/user/editor/"
    var userRank = WazeWrap.User.Rank();
    var TextToSend = ':' + translationsInfo[11][0] + RequiredLevel + ": " + translationsInfo[10][0] + " : <" + escape(profileurl) + W.loginManager.user.userName + "|" + W.loginManager.user.userName + "> (*" + translationsInfo[11][0] + userRank + "*)\r\n" + translationsInfo[12][0] + " : <" + escape(permalink) + "|" + textSelection + ">\r\n" + translationsInfo[13][0] + " : " + iconactionlocale + "\r\n" + translationsInfo[14][0] + " : " + CityName + separatorCity + StateName + separatorState + CountryName + Details;
    var TexToSendTelegramMD = `${translationsInfo[11][0]}${RequiredLevel} *${translationsInfo[10][0]}:* [${W.loginManager.user.userName}](www.waze.com/user/editor/${W.loginManager.user.userName}) (*${userRank}*)
*${translationsInfo[12][0]} :* [${textSelection}](${permalink})
*${translationsInfo[13][0]} :* ${iconactionlocale}
*${translationsInfo[14][0]} :* ${CityName}, ${StateName}, ${CountryName}
${closureTelegramDetails}${telegramDetails}`;
    TextToSend = TextToSend.replace('\r\n\r\n','\r\n');
    // Get the webhooks

    if(Reason !== 'Cancelled' && chanel !== "" && abort === false) {
        for (var key in serverDB[localStorage.getItem('WMESTSServer')])
        {
            switch (key.toLowerCase()) {
                case "discord":
                case "slack":
                    log('Chanel : ' + chanel);
                    var actionicon="";
                    log(iconaction)
                    switch(iconaction.toLowerCase()) {
                        case "closure":
                            actionicon = "road_closed"
                            break;
                        case "open":
                            actionicon = "open_closure"
                            break;
                        case "lock":
                            actionicon = "lock"
                            break;
                        case "downlock":
                            actionicon = "unlock"
                            break;
                        case "validation":
                            actionicon = "heavy_check_mark"
                            break;
                        default:
                            actionicon = "pencil2"
                    }
                    if(key.toLowerCase() == "slack")
                    {
                        $.ajax({
                            data: 'payload=' + JSON.stringify({
                                "text": TextToSend,
                                "username": ScriptName + " " + GM_info.script.version,
                                "mrkdwn": true,
                                "channel": serverDB[localStorage.getItem('WMESTSServer')][key]["chanel_" + chanel],
                                "icon_emoji": actionicon
                            }),
                            processData: false,
                            type: 'POST',
                            url: serverDB[localStorage.getItem('WMESTSServer')][key][chanel],
                            error: function(x, y, z)
                            {
                                log('Slack error : ' + x + ' ' + y + ' ' + z);
                            }
                        });
                    } else if (key.toLowerCase() == "discord")
                    {
                        var discrordreplaceto = {
                            N1: "①",
                            N2: "②",
                            N3: "③",
                            N4: "④",
                            N5: "⑤",
                            N6: "⑥",
                            L1: "①",
                            L2: "②",
                            L3: "③",
                            L4: "④",
                            L5: "⑤",
                            L6: "⑥",
                            ":": "*"
                        };
                        var discrordreplacefrom = new RegExp(Object.keys(discrordreplaceto).join("|"), "gi");
                        $.ajax({
                            data: 'payload=' + JSON.stringify({
                                "attachments": [{
                                    "text": TextToSend.replace(discrordreplacefrom, function(matched) {
                                        return discrordreplaceto[matched]
                                    })
                                }],
                                "username": ScriptName + " " + GM_info.script.version,
                                "mrkdwn": true,
                                "channel": serverDB[localStorage.getItem('WMESTSServer')][key]["chanel_" + chanel],
                                "icon_emoji": actionicon
                            }),
                            processData: false,
                            type: 'POST',
                            url: serverDB[localStorage.getItem('WMESTSServer')][key][chanel],
                            error: function(x, y, z)
                            {
                                log('Discord error : ' + x + ' ' + y + ' ' + z);
                            }
                        });
                    }
                    log(TextToSend);
                    sent=sent+1;
                    break;
                case "gform":
                    var projI=new OpenLayers.Projection("EPSG:900913");
                    var projE=new OpenLayers.Projection("EPSG:4326");
                    var currentlocation = (new OpenLayers.LonLat(Waze.map.getCenter().lon,Waze.map.getCenter().lat)).transform(projI,projE).toString().replace('lon=','').replace("lat=","");
                    var GFormDBloc = gFormDB[localStorage.getItem('WMESTSServer')];
                    var datas = {};
                    datas[GFormDBloc.pl]=unescape(permalink);
                    datas[GFormDBloc.username]=W.loginManager.user.userName;
                    datas[GFormDBloc.editorlevel]=WazeWrap.User.Rank();
                    datas[GFormDBloc.levelrequired]=RequiredLevel.toString().replace(/:/g,'').replace('l','');
                    datas[GFormDBloc.type]=selectedtype;
                    datas[GFormDBloc.longlat]=currentlocation;
                    datas[GFormDBloc.requesttype]=iconaction;
                    datas[GFormDBloc.city]=CityName;
                    datas[GFormDBloc.country]=CountryName;
                    datas[GFormDBloc.selectcount]=countselected;
                    datas[GFormDBloc.communitypart]=chanel;
                    datas[GFormDBloc.message]=Details;
                    $.ajax({
                        url: serverDB[localStorage.getItem('WMESTSServer')][key]['url'],
                        data: datas,
                        type : "POST",
                        dataType: "xml",
                        error: function(x, y, z)
                        {
                            log(x + ' ' + y + ' ' + z);
                        }
                    });
                    sent=sent+1;
                    break;
                case "telegram":
                    var dataTelegram = {
                      chat_id: serverDB[localStorage.getItem('WMESTSServer')][key]['chat_id'],
                      text: TexToSendTelegramMD,
                      parse_mode: "Markdown",
                      disable_web_page_preview: true
                    };
                    $.ajax({
                        data: dataTelegram,
                        type: 'POST',
                        url: serverDB['DEVns_en'][key]['editing'],
                        error: function(x, y, z)
                        {
                            log('Telegram error : ' + x + ' ' + y + ' ' + z);
                        }
                    });
                    log("Telegram request processed")
                    sent=sent+1
                  break;
                default:
            }
        }
    }
    if(sent>0) {
        WazeWrap.Alerts.success(ScriptName, translationsInfo[15][0]);//"Request Sent"
    } else {
        WazeWrap.Alerts.error(ScriptName, translationsInfo[16][0]);//'Nothing sent'
    }
}


