// Create the permalink
function getPermalinkCleaned(iconaction) {
    text = "https://www.waze.com/editor?env=" + W.app.getAppRegionCode() + "&";
    var count = 0;
    var texttype = "venue"
    var textTypeLoc = translationsInfo[23][0] + " : " + W.selectionManager.getSelectedFeatures()[0].model.attributes.name; //"venue"
    var CityName = "";
    var CountryName = "";
    var StateName = "";
    var selectedindex="";
    var selectiontype="&venues=";
    var RequiredRank = 0;
    var ShouldBeLockedAt = -5;
    var projI=new OpenLayers.Projection("EPSG:900913");
    var projE=new OpenLayers.Projection("EPSG:4326");
    var center = W.map.getCenter();
    var mapCenter = new OpenLayers.Geometry.Point(center.lon,center.lat);
    var currentlocation = (new OpenLayers.LonLat(mapCenter.x,mapCenter.y)).transform(projI,projE).toString().replace(',','&');
    $.each(W.selectionManager.getSelectedFeatures(), function(indx, section){
        if(texttype == "venue") { texttype = section.model.attributes.categories }
        if(selectedindex!="")
        {
            selectedindex=selectedindex + ",";
        }
        selectedindex = selectedindex + section.model.attributes.id;
        if(section.model.type == "camera")
        {
            selectiontype="&cameras=";
            texttype="camera";
            textTypeLoc = translationsInfo[24][0]
        } else if(section.model.type == "bigJunction")
        {
            selectiontype="&bigJunctions=";
            texttype="JB";
            textTypeLoc = translationsInfo[25][0]
        } else if (section.model.type == "mapComment")
        {
            selectiontype="&mapComments=";
            texttype="map comment";
            textTypeLoc = translationsInfo[26][0]
        } else if (section.model.type == "railroadCrossing")
        {
            selectiontype="&railroadCrossings=";
            texttype="Railroad Crossing";
            textTypeLoc = translationsInfo[27][0]
        }
        else if(section.model.type == "restrictedDrivingArea"){
            selectiontype="&restrictedDrivingAreas=";
            texttype="Restricted Area";
            textTypeLoc = translationsInfo[37][0];
        }
        else if(section.model.type !== 'venue')
        {
            selectiontype="&segments=";
            texttype="segment";
            textTypeLoc = translationsInfo[28][0];
            ShouldBeLockedAt = getShouldLockedAt(section, ShouldBeLockedAt)
        }
        count++;
        if(section.model.attributes.lockRank !== null && section.model.attributes.lockRank > RequiredRank) {
            RequiredRank = section.model.attributes.lockRank;
        } else if(section.model.attributes.rank > RequiredRank) {
            RequiredRank = section.model.attributes.rank;
        }
        CityName = GetCity(GetCityID(section, texttype));
        if(CityName == null) {
            CityName = "";
        }
        CountryName = GetCountry(GetCityID(section, texttype));
        StateName = GetState(GetCityID(section, texttype));
        log("State Name : " + StateName);
        if(StateName == false) {
            StateName = "";
            log("State Name : emptyied" + StateName);
        }
    });
    if(ShouldBeLockedAt == -5) { ShouldBeLockedAt = ""; }
    var PL = text + currentlocation + "&zoomLevel=" + W.map.getOLMap().getZoom() + selectiontype + selectedindex;
    var type = textTypeLoc;
    if (count>1) {
        type = count + " " + type + translationsInfo[29][0];
    } else {
        type = translationsInfo[30][0] + " " + type
    }
    if(RequiredRank<2 && (iconaction.toLowerCase() == "closure" || iconaction.toLowerCase() == "open")) { RequiredRank = 2; }
    RequiredRank = (RequiredRank + 1);

    // Return built array containing all parameters
    var arr = [PL, type, count, texttype, RequiredRank, CityName, CountryName, ShouldBeLockedAt, StateName]
    return arr;
}

// Check the version of the scritpt in the browser to Warn if the script has been updates
function VersionCheck() {
    ///////////////////////////////////////
    //         Check for updates         //
    ///////////////////////////////////////
    if (localStorage.getItem('WMESTSVersion') === ScriptVersion && 'WMESTSVersion' in localStorage) {
        // Do nothing
    } else if ('WMESTSVersion' in localStorage) {
        if(!WazeWrap.Interface) {
            setTimeout(VersionCheck, 1000);
            log("WazeWrap not ready, waiting");
            return;
        }
        UpdateNotes = "";
        for (var key in _WHATS_NEW_LIST) {
            if(ScriptVersion == key) {
                UpdateNotes = "What's New ?<br />";
            }
            if(UpdateNotes != "")
            {
                UpdateNotes = UpdateNotes + "<br />" + key + ": " + _WHATS_NEW_LIST[key];
            }
        }
        UpdateNotes = UpdateNotes + "<br />&nbsp;";
        WazeWrap.Interface.ShowScriptUpdate(ScriptName, ScriptVersion, UpdateNotes, "https://gitlab.com/WMEScripts/WME-send-to-slack-public");
        localStorage.setItem('WMESTSVersion', ScriptVersion);
        $(".WWSUFooter a").text("Gitlab")
    } else {
        localStorage.setItem('WMESTSVersion', ScriptVersion);
    }
}

// Check if the required parameters are Set
function CheckNeededParams() {
    // Inits
    log("Checking the needed parameters");
    var check = true;

    // Check all needed params
    for (var key in neededparams) {
        if (!(key in localStorage)) {
            log("\tMissing : " + key);
            check = false;
        }
    }

    // How was the check going on?
    if (!check) {
        WazeWrap.Alerts.error(ScriptName, translationsInfo[22][0]);
    }
    return check;
}
